// Target the popover container
const popover = document.querySelector('div.a-popover-wrapper');

if (popover) {
    // Get all list items within the listbox
    const listItems = popover.querySelectorAll('ul[role="listbox"] li');

    // Check if the second item (index 1) exists
    if (listItems.length >= 2) {
        // Find the link within that second list item
        const secondOption = listItems[1].querySelector('a.a-dropdown-link');

        if (secondOption) {
            secondOption.click();
        } else {
            console.error("Could not find the clickable link in the second row.");
        }
    } else {
        console.error("The dropdown only has " + listItems.length + " item(s). Need at least 2.");
    }
} else {
    console.error("Popover not found. Make sure the menu is open.");
}

